import React from 'react';

const FAQSection = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-[#FFFF] p-8">
      {/* Основной контейнер */}
      <div className="max-w-6xl w-full flex flex-col md:flex-row items-center gap-8">
        {/* Левая часть: Фоновая картинка */}
        <div className="hidden md:block flex-1 relative">
          <img
            src="/images/img20.png" // Замените на путь к вашей фоновой картинке
            alt="Background"
            className="w-full h-auto opacity-50" // Фоновая картинка с прозрачностью
          />
        </div>

        {/* Центральная часть: Основная картинка */}
        <div className="flex-1 flex justify-center">
          <img
            src="/images/imag10.png" // Замените на путь к вашей основной картинке
            alt="Placeholder"
            className="w-2/3 h-auto rounded-lg shadow-lg" // Уменьшено в 1.5 раза
          />
        </div>

        {/* Правая часть: Текст и кнопки */}
        <div className="flex-1 flex flex-col space-y-8">
          {/* Заголовок */}
          <div className="text-left">
            <h1 className="text-4xl font-bold text-gray-800 mb-4">Frequently Asked Questions</h1>
            <h2 className="text-2xl text-gray-600">You’ve Any Questions</h2>
          </div>

          {/* Две кнопки */}
          <div className="space-y-6">
            {/* Первая кнопка */}
            <button className="w-full inline-flex p-4 pl-10 justify-start items-center gap-4 rounded-lg bg-[#F8F7F0] hover:bg-[#E0DFD8] transition duration-300">
              <h3 className="text-xl font-bold text-gray-800">World’s hottest destinations for vegans</h3>
            </button>

            {/* Вторая кнопка */}
            <button className="w-full inline-flex p-4 pl-10 justify-start items-center gap-4 rounded-lg bg-[#F8F7F0] hover:bg-[#E0DFD8] transition duration-300">
              <h3 className="text-xl font-bold text-gray-800">Let’s grow naturally and live naturally</h3>
            </button>
          </div>

          {/* Текст между второй и третьей кнопкой */}
          <div className="text-gray-600">
            <p>
              Suspendisse finibus urna mauris, vitae consequat quam vel. Vestibulum leo
              ligula, molestie ullamcorper vulputate vitae sodales commodo nisl. Nulla
              facilisi. Pellentesque est metus many of some form.
            </p>
          </div>

          {/* Третья кнопка */}
          <button className="w-full inline-flex p-4 pl-10 justify-start items-center gap-4 rounded-lg bg-[#F8F7F0] hover:bg-[#E0DFD8] transition duration-300">
            <h3 className="text-xl font-bold text-gray-800">Best vegetables for your healthy hair</h3>
          </button>
        </div>
      </div>
    </div>
  );
};

export default FAQSection;
